No, It's the function which will create an dictionary which has sensor name as key and inside that threshold key(LowerCritical, LowerFatal,..etc) as key and respective threshold value as value.

For example,
${redfish_sensor_id_threshold_mapping} = {"sensor_1" : {'UpperCaution': 100.0, 'UpperCritical': 122.0}}

Can u please combined 'Get Sensor Unit', 'Get Sensor ID' and 'Get Redfish Sensor Reading Value' keywords.

Lets make generic keywords.

where ${required_field} can be 'ReadingUnits' or 'Reading' or 'Id'

Get Required Redfish Sensor Reading

[Arguments]  ${sensor_uri}  ${required_field}

${sensor_properties}=  Redfish.Get Properties  ${sensor_uri}
[Return]  ${sensor_properties[${required_field}]}

Can u please combined 'Get Redfish Sensor Status' and 'Get Redfish Sensor Health State' keywords together? So that it can be generic.

where  ${required_field} is 'State' or 'Health'

Get Redfish Sensor Status

 [Arguments]  ${sensor_uri}   ${required_field}

 ${sensor_properties}=  Redfish.Get Properties  ${sensor_uri}
 [Return]  ${sensor_properties['Status'][${required_field}]}
